import React from 'react';
import { Bar, Line, Pie } from 'react-chartjs-2';
import coqSummitData from '../data/coqSummitData.json';

const data = coqSummitData;
export const Chart = () => {
  return (
    <div className="chart">
      <Line
        data={data}
        options={{
          maintainAspectRatio: false
        }} />
    </div>
  );
};
